import "./LineData.css";
import "./Lab1EmptyList.css";

function LineData(props) {

    function textChangeWrapper(e) {
        props.onItemChanged(props.line.key, "text", e.target.value);
        props.onItemAdded();
    }

return (
    <li>
        <input type={"checkbox"} className={"checkboxes"}/>
        <input type={"text"}
               className={"textboxes"}
               value={props.line.text}
               onClick={(e) => e.stopPropagation()}
               onChange={(e) => textChangeWrapper(e)}/>
    </li>
)
}

export default LineData;
